import React, { useState } from 'react';
import { Route, Switch } from "react-router-dom";
import Intro from '../Intro/Intro';
import CityData from '../CityData/CityData';

class Main extends Component {

  render() {
    return (
      <div className="Main">
        <Switch>
          <Route exact path="/">
              <Intro />
          </Route>
          <Route exact path="/citydata/:id">
              <CityData />
          </Route>
        </Switch>
      </div>
    )
  }
}

export default Main
